  render() {
    if (this.props.user) {
      return (
        <React.Fragment>
          <nav>
            <div class="nav-wrapper">

              <NavLink to={"/"} className="brand-logo">
                <img src={Box} className="logo-img"/>
                Jakku
              </NavLink>

              <ul class="right hide-on-med-and-down">
                <li>
                  <a href="#" className="profile-container" >
                    {this.props.user.username}
                    <img className="profile-image"
                      src={this.props.user.imgPath}
                      alt="User profile image"
                    />

                  </a>
                </li>
              </ul>
              <div>
                <a href="#" data-target="mobile-demo" class="sidenav-trigger">
                <i class="material-icons">menu</i>
              </a>
                  <SideNav
                    className="sidenav" id="mobile-demo"
                    trigger={<i class="material-icons"></i>}
                    options={{ closeOnClick: true }, {edge: 'right'}}
                  >
                    <SideNavItem
                      userView
                      user={{
                        background: `${this.props.user.imgPath}`,
                        image:
                          `${Box}`,
                        name: `${this.props.user.username}`
                      }}
                    />
                    <SideNavItem href="#!icon" icon="cloud">
                      First Link With Icon
                    </SideNavItem>
                    <SideNavItem href="#!second">Second Link</SideNavItem>
                    <SideNavItem divider />
                    <SideNavItem subheader>Subheader</SideNavItem>
                    <SideNavItem waves onClick={this.logout}>
                      Salir
                    </SideNavItem>
                  </SideNav>
                </div> 
            </div>


          </nav>

        </React.Fragment>
      );
    } else {
      return (
        <React.Fragment>
          <nav>
            <div class="nav-wrapper">
              <NavLink to={"/"} className="brand-logo">
                <img
                  src="../../img/21eaecb818a8dd6c5286b5f66886d918.jpg"
                  alt="Box image logo"
                />
                <h1>Jakku</h1>{" "}
              </NavLink>
              <a href="#" data-target="mobile-demo" class="sidenav-trigger">
                <i class="material-icons">menu</i>
              </a>
              <ul class="right hide-on-med-and-down">
                <li>
                  <a href="sass.html">Sass</a>
                </li>
                <li>
                  <a href="badges.html">Components</a>
                </li>
                <li>
                  <a href="collapsible.html">Javascript</a>
                </li>
                <li>
                  <a href="mobile.html">Mobile</a>
                </li>
              </ul>
            </div>
          </nav>

          {/* <ul class="sidenav" id="mobile-demo">
          <li><a href="sass.html">Sass</a></li>
          <li><a href="badges.html">Components</a></li>
          <li><a href="collapsible.html">Javascript</a></li>
          <li><a href="mobile.html">Mobile</a></li>
        </ul> */}
        </React.Fragment>
      );
    }
  }
}
export default withRouter(Navbar);
